import { Link } from 'react-router-dom'

function Navbar() {
    return (
        <div className='navbar text'>
            <Link to='/' className='navbar-btns'>About</Link>
            <Link to="/projects" className='navbar-btns'>Projects</Link>
        </div>  
    )
}

export default Navbar
